  PRIMARY KEY (`buyerID`),
  UNIQUE KEY `buyerEmailID` (`buyerEmailID`),
  CONSTRAINT `buyer_chk_1` CHECK ((`buyerID` like _utf8mb4'B%')),
  CONSTRAINT `buyer_chk_2` CHECK (((2022 - year(`dob`)) >= 15)),
  CONSTRAINT `buyer_chk_3` CHECK ((regexp_like(`buyerPassword`,_utf8mb4'[A-Z]') and regexp_like(`buyerPassword`,_utf8mb4'[!-@]') and (length(`buyerPassword`) >= 8)))
